type OldExercise = { id: string; name: string; category: string; sessions: OldSession[] };

function expandSets(oldSets: OldSet[]): { reps: number; weight: number }[] {
  const expanded: { reps: number; weight: number }[] = [];
  for (const set of oldSets) {
    for (let i = 0; i < set.count; i++) {
      expanded.push({ reps: set.reps, weight: set.weight });
    }
  }
  return expanded;
}

function migrateData(oldData: { exercises: OldExercise[] }): WorkoutData {
  return {
    exercises: oldData.exercises.map(exercise => ({
      id: exercise.id,
      name: exercise.name,
      category: exercise.category,
      sessions: exercise.sessions.map(session => ({
        id: session.id,
        date: session.date,
        sets: expandSets(session.sets),
      })),
    })),
    workoutSessions: [],
  };
}

export const bootstrapData: WorkoutData = migrateData(originalData);
